kind: Secret
metadata:
  name: telemetry-additional-scrape-configs
  namespace: testreplace-telemetry
type: Opaque
---
apiVersion: v1
kind: Service
metadata:
  labels:
    k8s-app: prometheus
    kubernetes.io/cluster-service: "true"
  name: prometheuslb
  namespace: testreplace-telemetry
spec:
  ports:
  - port: 9090
    targetPort: 9090
  selector:
    prometheus: telemetry
---
apiVersion: policy/v1beta1
kind: PodDisruptionBudget
metadata:
  name: prometheus-pdb
  namespace: testreplace-telemetry
spec:
  maxUnavailable: 1
  selector:
    matchExpressions:
    - key: prometheus
      operator: In
      values:
      - prometheus-telemetry
---
apiVersion: monitoring.coreos.com/v1
kind: Prometheus
metadata:
  labels:
    prometheus: telemetry
  name: telemetry
  namespace: testreplace-telemetry
spec:
  additionalScrapeConfigs:
    key: prometheus-additional.yaml
    name: telemetry-additional-scrape-configs
  affinity:
    podAntiAffinity:
      preferredDuringSchedulingIgnoredDuringExecution:
      - podAffinityTerm:
          labelSelector:
            matchExpressions:
            - key: prometheus
              operator: In
              values:
              - prometheus-telemetry
          topologyKey: failure-domain.beta.kubernetes.io/zone
        weight: 100
      requiredDuringSchedulingIgnoredDuringExecution:
      - labelSelector:
          matchExpressions:
          - key: prometheus
            operator: In
            values:
            - prometheus-telemetry
        topologyKey: kubernetes.io/hostname
  alerting:
    alertmanagers:
    - name: alertmanager-service
      namespace: testreplace-telemetry
      port: 9093
  containers:
  - env:
    - name: ETCD_NODE_0
      value: etcd-0.etcd.kube-system.svc.cluster.local
    - name: ETCD_NODE_1
      value: etcd-1.etcd.kube-system.svc.cluster.local
    - name: ETCD_NODE_2
      value: etcd-2.etcd.kube-system.svc.cluster.local
    - name: PROMETHEUS_ETCD_CONFIG_PATH
      value: /configuration/telemetry/prometheus
    - name: PROMETHEUS_ETCD_CONFIG_PARSE_TIME
      value: "500"
    - name: PROMETHEUS_ETCD_CONFIG_INTERNAL_DIR
      value: /etc/prometheus/config_out/tgroups
    image: 477484470770.dkr.ecr.us-west-2.amazonaws.com/vnext/promoted/telemetry/etcdmetrics:2.0.0
    name: etcdmetrics
    volumeMounts:
    - mountPath: /etc/prometheus/config_out
      name: config-out
  enableAdminAPI: true
  externalLabels:
    env_purpose: dev
    prometheus_env: testreplace-telemetry
  externalUrl: http://localhost:8001/api/v1/namespaces/testreplace-telemetry/services/prometheuslb/proxy/
  image: 477484470770.dkr.ecr.us-west-2.amazonaws.com/vnext/promoted/telemetry/prometheus_official:2.0.0
  podMetadata:
    annotations:
      prometheus.io/port: "9090"
      prometheus.io/scrape: "true"
    labels:
      app: prometheus
      service: telemetry
      solution: addons
  replicas: 3
  resources:
    limits:
      cpu: 4
      memory: 8Gi
    requests:
      cpu: 4
      memory: 8Gi
  retention: 1d
  retentionSize: 80GB
  ruleNamespaceSelector: {}
  ruleSelector:
    matchLabels:
      prometheus: prometheus-telemetry
      role: alert-rules
  scrapeInterval: 60s
  scrapeTimeout: 45s
  securityContext:
    fsGroup: 0
    runAsNonRoot: false
    runAsUser: 0
  serviceAccountName: prometheus-telemetry
  serviceMonitorNamespaceSelector: {}
  serviceMonitorSelector:
    matchLabels:
      scrapper: default
  storage:
    volumeClaimTemplate:
      spec:
        resources:
          requests:
            storage: 100Gi
        storageClassName: standard-encrypted-zones
  thanos:
    baseImage: 477484470770.dkr.ecr.us-west-2.amazonaws.com/vnext/promoted/telemetry/thanos:2.0.0
    objectStorageConfig:
      key: thanos.yaml
      name: thanos-objstore
    version: 2.0.0
  version: 2.0.0
